import React from 'react';

//components


// data entry
import dummyData from '../questionPosts_db';

const MainFeed = () => {
    console.log(dummyData);

    return (
        <div className="main-feed" >
            <div className="post-input-box">
                <div className="post-input-area">
                    <div className="user-profile-pic">
                        <img src="https://randomuser.me/api/portraits/women/72.jpg" alt="user picture" />
                    </div>
                    <div className="post-input">
                        <textarea placeholder="What do you wanna post today?..."></textarea>

                    </div>

                </div>

                <button className="mainCTA">Post</button>
            </div>



        </div>
    )


}

export default MainFeed;
